@Joseph Carlson After Hours Actually, the vast majority of hedge funds don’t benchmark at all because the goals and allocations don’t align. 

Benchmarking is meant to compare against a like fund or allocation/risk profile to gauge performance. If you agree that SPY and your basket in the growth portfolio match then great. I think your portfolio is a high beta tech heavy and large gap growth oriented. For that reason, to me QQQ is a better reflection. 

Not everyone that posts any criticism of what you say/write is raging by the way, but I’m sure it’s easier to paint it that way.

@V.K. Media ವಿಶ್ವ ಕಿರಣ oh woops, I didn't see phone in your question. Sorry about that. 
I only have experience with iPhones. I think the Iphone SE I bought is a great phone for stock photos and even better for video. But it's about $200 more than your budget. You could look around for a second hand one. You could also go for the Iphone 10, but they are not as good. You could save a bit more for the iPhone SE. I made a video about it so check my channel archive.
I also think you can look around for the other Android handsets, which also do great video and stills. Hope this helps!
